  Descendants of WILLIAMS, William and NELSON, Jane
  JWILLIAMS, William Leonard and WANKLYN, Sarah
  JWILLIAMS, Alfred Henry and HARVEY, Lucy Caroline Simpson
  HARVEY WILLIAMS, Samuel Frederick and COOK, Dorothy Helen
  JHARVEY WILLIAMS, Barbara Louise and DAY, Jeremy John
  01> DAY, Crispin Mark Jeremy
  b 15.08.1960
  Address: Bailiffs, Little Gaddesden, Berkhamsted, Herts, England HP4 IPN; Email:
  crispind@dircon.co.uk.
  Crispin was educated at Chafyn Grove School in Wiltshire and then Wellington College in Berkshire.
  In 1979 he was commissioned into the Royal Marines and saw service in England, Northern Ireland and
  Norway. In 1984 he left the Marines to move into the world of Polar travel and field guiding. His
  first major expedition in 1984-85 was as part of a 3-man 9-month over-wintering trip at latitude 80
  north. He followed this with a further winter in Svalbard. In 1986 he went south to Antarctica for
  22 years as a field guide for the British Antarctic Survey. He returned home to become Pole team
  reserve and base camp manager for the 1989 Icewalk International North Pole Expedition, He had a
  brief stint working for the Expedition Advisory Centre at the London based Royal Geographical
  Society before joining the Cambridge Arctic Shelf Programme (CASP). From 1990 -1994 he was the
  logistics and field program manager for CASP and was field leader for five arctic seasons for them
  and a further three Antarctic Seasons for the British Antarctic Survey. In 1994 he left CASP to
  complete a Trans- Greenland ski crossing and then become one of the team members of the Tandem One
  Step Beyond South Pole Challenge in celebration of UNESCO's 50th Anniversary during which he and
  two companions completed a 1,000-mile ski trek from the South Pole out to the Antarctic coast using
  kite power alone to pull their sledges. In the northern hemisphere winter of 1997-98 he was a team
  member of Dogtrek, a Trans-America Dogsled Expedition, raising funds for International Cancer
  Charities.
  02> WILLIAMS, James Leonard Harvey m on 15.01.1946 to TAIT, Susan Proudlock
  b 29.10.1901 d 14.03.1989
  b 15.07.1909 d 15.10.1981
  James b. at Harrow, England, m. at Bombay, India and d. and bd, at Rudgwick, Sussex, England. Susan also
  bd, at Rudgwick.
  Jim was educated at Orley Farm and Harrow School, where he won his fez for Harrow football. After leaving
  Harrow he worked on a farm for three years until, in 1921, he went to University College, Reading to take a
  two year Agricultural Diploma course. He played tennis and hockey at Reading and was Captain of tennis. In
  1924 he joined Tea Estates India, a subsidiary of Brooke Bond Ltd, and was successively Manager of Monica
  Estate (1929-39), Visiting Agent (1939-42) and Chairman (1942-56). Returning to England in 1956, he settled
  at Rudgwick and joined Francis Peek & Co, another subsidiary of Brooke Bond, retiring as Chairman in 1967.
  01> WILLIAMS, Robert John Harvey
  b 21.03.1948 d 10.09.1965
  Robert b. at Ootacamund, South India and bd. at Rudgwick, Sussex, England. Robert was educated at
  Harrow School but, in the summer holidays before what would have been his last term there, whilst
  working on a farm of an old friend of his father, at Wormleighton, Warwickshire, he was tragically
  killed when the car he was driving ran off the road and hit a tree.
  03> HARVEY WILLIAMS, Richard Stuart m on 06.06.1934 to CHEER, Elsie Maie
  b 17.04.1905 d 12.06.1981
  b 21.01.1909 d 30.12.1987
  Richard b. at Harrow, England. Elsie, d/o Henry Walter Cheer and Lucy May Haycock, b. at
  Elsthorpe. Dick was educated at Orley Farm, Bowden House and Harrow School. His life-long
  passion was cars and he worked for a time in a garage but he then emigrated to New Zealand
  in March 1922. He worked as a shepherd on farms in Ruatoria and Omakere until 1948 when he
  bought "Brooklands" at Glen Murray. There he was a committee member of the Te Akau North
  Rabbit Board, the St John's vestry in Tuakau and the Glen Murray Tennis Club. Elsie taught
  piano, was a keen supporter of the Red Cross, a social worker for Kingseat Hospital and a member of the
  Country Women's Division of Federated Farmers and the Indoor Bowling Club. They retired to Pukekohe in 1966
  where they were active members of St Andrew's Anglican Church. In 1979 they moved to Cambridge.
